, which have been intermingled to form a bridge that can hold several people at a time. Khasi people have been trained to grow these bridges across the raised banks of streams to form a solid bridge, made from root, for generations. This is one of the most popular ones from the village of Mawlynong, some 60 odd kilometres south of Shillong. The travel magazine Discover India declared the village as the cleanest in Asia in 2003, and the cleanest in India in 2005, and that reputation has given a great boost to tourism here.  The people have preserved their culture, and these root bridges pretty well too. Though the excessive tourism in the area has stressed out these root bridges since they were never meant to handle such pressure.
The stream beneath the root bridge is equally beautiful.
